import nltk
from nltk.corpus import stopwords
import re

nltk.download('stopwords')

def remove_stopwords(text):
  stop_words = set(stopwords.words('english'))

  if isinstance(text, str):
    text = text.strip('[]')
    words = re.findall(r'\'([^\']+)\'|"([^"]+)"', text)
    words = [w[0] or w[1] for w in words if w[0] or w[1]]
  else:
    words = text

  cleaned_text = []
  for word in words:
    word = word.strip().strip("'").strip('"').strip()
    if word and word.lower() not in stop_words:
      cleaned_text.append(word)
  return cleaned_text

df = pd.read_csv('iOS-reviews-tokenized.csv')

df['stopwords_removed'] = df['review_tokenized'].apply(remove_stopwords)

df.to_csv('iOS-reviews-stopword.csv', index=False)
print("Stopword removal selesai! Hasil telah disimpan di iOS-reviews-stopword.csv")

import ast

input_file = 'iOS-reviews-stopword.csv'
data = pd.read_csv(input_file)

def to_lowercase(content):
  try:
    # Use ast.literal_eval to safely parse the string representation of a list
    words = ast.literal_eval(content)
    return str([word.lower() for word in words])
  except (AttributeError, SyntaxError, ValueError): # Handling potential errors during parsing
    return content

df['final'] = df['stopwords_removed'].apply(to_lowercase)

df.to_csv('iOS-reviews-final.csv', index=False)
print("Lowercasing selesai! Hasil telah disimpan di iOS-reviews-final.csv")

from transformers import pipeline

input_file = 'iOS-reviews-stopword.csv'
df = pd.read_csv(input_file)

sentiment_analyzer = pipeline('sentiment-analysis')

def predict_sentiment(text):
  result = sentiment_analyzer(text)[0]
  return 1 if result['label'] == 'POSITIVE' else 0

df['sentiment'] = df['stopwords_removed'].apply(predict_sentiment)

df.to_csv('iOS-reviews-sentiment.csv', index=False)
print("Sentiment analysis selesai! Hasil telah disimpan di iOS-reviews-sentiment.csv")

input_file = 'iOS-reviews-sentiment.csv'
df = pd.read_csv(input_file)

def labeling(rating):
  if rating in [1,2]:
    return 0
  if rating in [4,5]:
    return 1
  else:
    return None #Handle Neutral scores like 3

df['rating_label'] = df['rating'].apply(labeling)

df.to_csv('iOS-reviews-labeled.csv', index=False)
print("Labeling selesai! Hasil telah disimpan di iOS-reviews-labeled.csv")

