# List of words to exclude (case insensitive)
# Creating a new list variable to hold the stop words
stop_words = [
    "connection", "install", "package", "week", "first", "entered", "side", "episode", "cast",
    "characters", "registered", "pro", "help", "picture", "entered", "basic", "month", "dark",
    "english", "kids", "full", "site", "youtube", "gopay", "telkomsel", "money", "credit",
    "default", "new", "think", "made", "sent", "stop", "stuck", "keeps", "happy", "see",
    "world", "either", "usually", "wrong", "smoothly", "asking", "play", "increase", "limited",
    "especially", "black"
]

# Combine all the text from the 'text_without_stopwords' column
text = ' '.join(df['stopwords_removed'].dropna())

# Clean the text by removing unwanted characters like punctuation
text = re.sub(r"[^\w\s]", "", text)  # Remove punctuation using regex

# Split the text into words and filter out the excluded words (case insensitive)
# Use custom_stopwords directly instead of custom_stopwords.extend
words = [word.lower() for word in text.split() if word.lower() not in stop_words] # using the new stop_words variable here

